import React from "react";
import AppBar from "@material-ui/core/AppBar";
import { makeStyles } from "@material-ui/core/styles";
import Toolbar from "@material-ui/core/Toolbar";
import HomeIcon from "../generalhome/HomeIcon";
import Link from "@material-ui/core/Link";
import "../../../../index.css";
import Grid from "@material-ui/core/Grid";
//import Paper from "@material-ui/core/Paper";
import Typography from "@material-ui/core/Typography";
import IconButton from "@material-ui/core/IconButton";
import MenuIcon from "@material-ui/icons/Menu";
import Badge from "@material-ui/core/Badge";
import NotificationsIcon from "@material-ui/icons/Notifications";
import AccountCircle from "@material-ui/icons/AccountCircle";

const useStyles = makeStyles((theme) => ({
  grow: {
    flexGrow: 1,
    backgroundColor: "#d2dae3",
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: "center",
    color: theme.palette.text.secondary,
  },
}));

export default function UserNavBar1() {
  const classes = useStyles();
  return (
    <div className={classes.grow}>
      <AppBar position="static" style={{ backgroundColor: "#00b643" }}>
        <Toolbar>
          <div style={{ width: "auto", height: "auto" }}>
            <Typography
              variant="h6"
              className={classes.title}
              style={{ textAlign: "left" }}
            >
              <Link
                href="/"
                style={{
                  color: "inherit",
                  fontFamily: "Lobster",
                }}
              >
                My Portfolio
              </Link>
            </Typography>
          </div>
          <div style={{ width: "3%", height: "auto" }}>
            <HomeIcon></HomeIcon>
          </div>
          <div
            style={{ width: "35%", height: "auto", border: "1px solid red" }}
          ></div>
          <div
            style={{ width: "auto", height: "auto", border: "1px solid blue" }}
          ></div>
        </Toolbar>
      </AppBar>
    </div>
  );
}
